void Resolver::Override()
{
	if (!g_Options.hvh_resolver_override)
		return;

	if (!g_InputSystem->IsButtonDown(g_Options.hvh_resolver_override_key))
		return;

	int cx, cy;

	//g_EngineClient->GetScreenSize(w, h);

	cx = Global::iScreenX / 2;
	cy = Global::iScreenY / 2;

	Vector crosshair = Vector(cx, cy, 0);

	C_BasePlayer * nearest_player = nullptr;
	float bestFoV = 0;
	Vector bestHead2D;

	for (int i = 1; i <= g_GlobalVars->maxClients; i++) //0 is always the world entity
	{
		C_BasePlayer *player = (C_BasePlayer*)g_EntityList->GetClientEntity(i);

		if (!CMBacktracking::Get().IsPlayerValid(player)) //ghetto
			continue;

		Vector headPos3D = player->GetBonePos(HITBOX_HEAD), headPos2D;

		if (!Math::WorldToScreen(headPos3D, headPos2D))
			continue;

		float FoV2D = crosshair.DistTo(headPos2D);

		if (!nearest_player || FoV2D < bestFoV)
		{
			nearest_player = player;
			bestFoV = FoV2D;
			bestHead2D = headPos2D;
		}
	}

	if (nearest_player) //use pointers and avoid double calling of GetClientEntity
	{
		int minX = cx - (Global::iScreenX / 10), maxX = cx + (Global::iScreenX / 10);

		if (bestHead2D.x < minX || bestHead2D.x > maxX)
			return;

		int totalWidth = maxX - minX;

		int playerX = bestHead2D.x - minX;

		int yawCorrection = -(((playerX * 360) / totalWidth));

		float_t new_yaw = yawCorrection;

		new_yaw = Math::ClampYaw(new_yaw);

		nearest_player->m_angEyeAngles().yaw += new_yaw;
	}
}

void Resolver::Resolve()
{
	for (int i = 1; i <= g_GlobalVars->maxClients; i++)
	{
		C_BasePlayer *player = C_BasePlayer::GetPlayerByIndex(i);
		if (!player || !player->IsAlive() || player->IsDormant() || player == g_LocalPlayer)
			continue;

		if (g_Options.hvh_resolver_override && g_InputSystem->IsButtonDown(g_Options.hvh_resolver_override_key))
		{
			Override();
			return;
		}

		//static float OldLowerBodyYaws[64];
		//static float OldYawDeltas[64];
		//float CurYaw = player->m_flLowerBodyYawTarget();
		//if (OldLowerBodyYaws[i] != CurYaw) {
		//	OldYawDeltas[i] = player->m_angEyeAngles().yaw - CurYaw;
		//	OldLowerBodyYaws[i] = CurYaw;
		//	player->m_angEyeAngles().yaw = CurYaw;
		//	continue;
		//}
		//else {
		//	player->m_angEyeAngles().yaw = player->m_angEyeAngles().yaw - OldYawDeltas[i];
		//}

		auto feet_yaw = player->GetPlayerAnimState()->m_flCurrentFeetYaw();
		auto body_max_rotation = 58.f;
		if (feet_yaw <= 58)
		{
			if (-58 > feet_yaw)
				player->m_angEyeAngles().yaw = body_max_rotation + player->m_angEyeAngles().yaw;
		}
		else
		{
			player->m_angEyeAngles().yaw = body_max_rotation - player->m_angEyeAngles().yaw;
		}
		if (player->GetAnimOverlay(6)->m_flPlaybackRate > 0.1)
		{
			for (int resolve_delta = 58.f; resolve_delta < -58.f; resolve_delta = resolve_delta - 20.f)
			{
				player->m_angEyeAngles().yaw = resolve_delta;
			}
		}
	}
}

void Resolver::ResolveCustom()
{
	for (int i = 1; i <= g_GlobalVars->maxClients; i++)
	{
		C_BasePlayer *player = C_BasePlayer::GetPlayerByIndex(i);
		if (!player || !player->IsAlive() || player->IsDormant() || player == g_LocalPlayer)
			continue;

		if (g_Options.hvh_resolver_override && g_InputSystem->IsButtonDown(g_Options.hvh_resolver_override_key))
		{
			Override();
			return;
		}
		if (g_Options.resolver_eyelby)
		{
			if (g_Options.resolver_eyelby_running && player->m_vecVelocity().Length2D() > g_Options.resolver_eyelby_running_value ||
				g_Options.resolver_eyelby_notrunning && !g_Options.resolver_eyelby_running && player->m_vecVelocity().Length2D() == 0.f ||
				g_Options.resolver_eyelby_always && !g_Options.resolver_eyelby_running && !g_Options.resolver_eyelby_notrunning ||
				!g_Options.resolver_eyelby_always && !g_Options.resolver_eyelby_notrunning && !g_Options.resolver_eyelby_notrunning &&
				g_Options.resolver_eyelby_after_x_shots && g_Options.resolver_eyelby_missed_shots < g_LocalPlayer->m_iShotsFired())
			{
				float_t new_yaw = player->m_flLowerBodyYawTarget();
				new_yaw = Math::ClampYaw(new_yaw);

				player->m_angEyeAngles().yaw = new_yaw;

				continue;
			}
		}
	}
}

